import React from 'react'
import img from '../img/짭쥐 표지-18_cut.png'

const Logo = () => {
  return (
    <div style={{
        display: 'flex',
        justifyContent: 'end',
        position: 'relative',
        width: '100vw',
        height:'80px',
        right: '20px',
        backgroundColor:'#3e448b'
    }}>
        <img src={img} style={{
          width:'300px', 
          height:'60px'}}/>
    </div>
  )
}

export default Logo
